import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Add an item to the cart to set up the test
    await page.waitForSelector("button.add-to-cart", { timeout: 5000 });
    await page.getByRole('button', { name: 'Add to Cart' }).first().click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_added.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_added.png'));

    // 2. Open the cart modal
    await page.waitForSelector("div.cart", { timeout: 5000 });
    await page.getByText(/Cart/).click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

    // 3. Remove the item from the cart
    await page.waitForSelector("button.remove-item", { timeout: 5000 });
    await page.getByRole('button', { name: 'Remove' }).click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_item_removed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_item_removed.png'));

    // 4. Verify the item was removed by checking for the empty cart message
    await page.waitForSelector(".empty-cart", { timeout: 5000 });
    const emptyCartLocator = page.locator('.empty-cart');
    const emptyCartText = await emptyCartLocator.textContent();

    return {
      success: true,
      action: "Successfully removed an item from the cart.",
      extractedData: {
        emptyCartMessage: emptyCartText
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
